In C language, you can round a double to two decimal places using the `round` function or by using arithmetic operations. 

1. Using `round` function:

   The `round` function rounds the input number to the nearest integer. To round a double to two decimal places, you can multiply the number by 100 and then use the `round` function.

   ```c
   #include <math.h>
   #include <stdio.h>

   int main() {
       double num = 3.14159265359;
       int rounded = round(num * 100.0);
       printf ("%d\n", rounded);
       return 0;
   }
   ```

2. Using arithmetic operations:

   You can also use arithmetic operations to round a double to two decimal places. You can subtract 0.5 and multiply the result by 100 to achieve the same effect as multiplying by 100 and then using the `round` function.

   ```c
   #include <stdio.h>

   int main() {
       double num = 3.14159265359;
       int rounded = (int) (num - 0.5) * 100;
       printf ("%d\n", rounded);
       return 0;
   }
   ```

In both examples, the output will be `3141592654` which is `3.14159265359` rounded to two decimal places.

