#include <math.h>
#include <stdio.h>

int main() {
    double input = 123.456789;
    double rounded_value;

    \/\/ Round the number to two decimal places
    rounded_value = (input \/ pow(10, 2)) * pow(10, 2);

    \/\/ Round to nearest even number if the decimal part is odd (optional)
    if (rounded_value % 2 != 0) {
        rounded_value = (rounded_value + 1) \/ 2;
    }

    printf("Rounded value: %.2f\n", rounded_value);

    return 0;
}
```
